const Custos = ({ notas }) => {
  let nNotas = [];
  //console.log(notas);
  for (let key in notas) {
    //console.log(notas[key]);
    nNotas.push(notas[key]);
  }

  return (
    <div>
      {nNotas.map((nota) => (
        <p>{nota.corretora}</p>
      ))}
    </div>
  );
};

export default Custos;
